sentence:
The list she drew up when only fourteen--I remember thinking it
did her judgment so much credit, that I preserved it some time;
and I dare say she may have made out a very good list now.

Run over a
few:--The Authors of the Bible; Aristotle; Pliny; Aldrovandi; Sir
Thomas Browne; Gesner; Ray; Linnaeus; Rondeletius; Willoughby; Green;
Artedi; Sibbald; Brisson; Marten; Lacepede; Bonneterre; Desmarest;
Baron Cuvier; Frederick Cuvier; John Hunter; Owen; Scoresby; Beale;
Bennett; J.  Ross Browne; the Author of Miriam Coffin; Olmstead; and
the Rev.

He was a stript
abstract; an unfractioned integral; uncompromised as a new-born babe;
living without premeditated reference to this world or the next.

I merely called,
because I would not pass the door without inquiring after Mrs. Bates;
but I have been so pleasantly detained!

Emma was in the humour to value simplicity and modesty to the utmost;
and all that was amiable, all that ought to be attaching,
seemed on Harriet's side, not her own.
